let convertStringToSlug=function(text){"use strict";return text.toLowerCase().replace(/[^\w ]+/g,"").replace(/ +/g,"-")};const sortTable=function(table,order){"use strict";const asc=order==="asc";const tbody=table.find("tbody");tbody.find("tr").sort(function(a,b){if(asc){return $("td:first",a).text().localeCompare($("td:first",b).text())}else{return $("td:first",b).text().localeCompare($("td:first",a).text())}}).appendTo(tbody)};const manageModal=function(modalElement){"use strict";modalElement.on("show.bs.modal",function(event){const modal=$(this);const button=$(event.relatedTarget);const url=button.data("url");const cancelText=button.data("cancel-text");const confirmText=button.data("confirm-text");const bodyText=button.data("body-text");let cancelButtonText=modal.find("#cancelButtonDefaultText").text();let confirmButtonText=modal.find("#confirmButtonDefaultText").text();if(typeof cancelText!=="undefined"&&cancelText!==""){cancelButtonText=cancelText}if(typeof confirmText!=="undefined"&&confirmText!==""){confirmButtonText=confirmText}modal.find("#cancel-action").text(cancelButtonText);modal.find("#confirm-action").text(confirmButtonText);modal.find("#confirm-action").attr("href",url);modal.find(".modal-body").html(bodyText)}).on("hide.bs.modal",function(){const modal=$(this);modal.find(".modal-body").html("");modal.find("#cancel-action").html("");modal.find("#confirm-action").html("");modal.find("#confirm-action").attr("href","")})};document.querySelectorAll("form").forEach(form=>{"use strict";form.addEventListener("submit",e=>{if(form.classList.contains("is-submitting")){e.preventDefault()}form.classList.add("is-submitting")})});